webpackJsonp([0x807fce6eb8df],{641:function(A,e){A.exports={data:{markdownRemark:{headings:[],html:"<p>Beausoleil is an environmentally conscious company that provides energy saving LEDs to consumers. In partnership with the Bumblebee Conservation Trust, Beausoleil donates a portion of the profits to the charity. </p>\n<p>With Bees as the inspiration, Beausoleil has created containers with colour and shape in mind. Each honeycomb is hexagon for the reason that it is both equilateral and equiangular. This shape makes it efficient for the use of building materials. </p>\n<p>The panels of the container display information from the LED bulbs that Beausoleil provides as well as information regarding the Bumble Bee conservation trust. The information is organized in hierarchy regarding the product being contained to educational points as to why bumble bees are essential to the earth. </p>\n<p>The amount of light bulbs each container holds correlate to the use of each bulb. Starting with the E26 600 Lumen bulb, sold in packs of 3 as it is the most common household bulb. The E26 400 lumen is sold in a pack of 1 as it is more commonly used for decorative ceiling lights and lastly  Beausoleil is containing a 2 pack E12 500 lumen  dimmable LED ideal for chandeliers and lanterns. The containers are thoughtfully designed with purpose, knowledge and branding in mind.</p>",frontmatter:{title:"Beausoleil - Environmental Sustainability in Package Design",graduate:"Angela Ip ",category:"Package Design",category2:null,category3:null,image:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.5,src:"/the-next-website/static/beausoleil-180-5ace8e03e0c7853a01d6f954a9531b0c-a7a62.jpg",srcSet:"/the-next-website/static/beausoleil-180-5ace8e03e0c7853a01d6f954a9531b0c-5a1a9.jpg 375w,\n/the-next-website/static/beausoleil-180-5ace8e03e0c7853a01d6f954a9531b0c-0908c.jpg 750w,\n/the-next-website/static/beausoleil-180-5ace8e03e0c7853a01d6f954a9531b0c-a7a62.jpg 1500w,\n/the-next-website/static/beausoleil-180-5ace8e03e0c7853a01d6f954a9531b0c-83d7d.jpg 2000w",sizes:"(max-width: 1500px) 100vw, 1500px"}}}}}},pathContext:{slug:"/work/beausoleil-environmental-sustainability-in-package-design/",name:"/Beausoleil - Environmental Sustainability in Package Design/"}}}});
